import { useState } from "react";


function Form (){

    const [searchValue, setSearchValue] = useState({
        city: '',
        state: ''
    })

   const handleFunction = (e) =>{
        const [name, value] = e.target;
        setSearchValue({
            [name]: value
        })
    }




    return(
        <div>
            <form>
                <input 
                name = "city" 
                placeholder = "City"
                onChange = {this.handleFunction}
                value = {searchValue.city}>
                </input>

                <input 
                name = "state" 
                placeholder = "State"
                onChange = {this.handleFunction}
                value = {searchValue.state}>
                </input> 

                <button onClick = {console.log(searchValue)}>Search!</button>
            </form>
        </div>
    )
}

export default Form;
